import { useParams } from 'react-router-dom';
import '../assets/css/index.css';

import Data from '../data/ModuleData.js';

function App() {

  const { id } = useParams();

  const Module = Data[id];

  return (
    <div className="App">
      <h1>{ id }</h1>
    </div>
  );
}

export default App;
